import { Routes, Route } from 'react-router-dom';
import { Elements } from "@stripe/react-stripe-js";
import { loadStripe } from "@stripe/stripe-js";
import LoginPage from './pages/LoginPage';
import HomePage from './pages/HomePage';
import ProductsPage from './pages/ProductsPage';
import AddProductPage from "./pages/AddProductPage";
import RegisterPage from "./pages/RegisterPage"; // ✅ Importer RegisterPage
import ForgotPasswordPage from "./pages/ForgotPasswordPage";
import CartPage from "./pages/CartPage";
import AccountPage from "./AccountPage";
import OrdersPage from "./OrdersPage";
import SupportPage from "./SupportPage";
import WalletPage from "./WalletPage";
import AddressesPage from "./AddressesPage";
import SuccessPage from './pages/SuccessPage';
import CancelPage from './pages/CancelPage';
import AdminDashboardPage from "./pages/AdminDashboardPage";
import AdminUsersPage from "./pages/AdminUsersPage"

const stripePromise = loadStripe("pk_live_51RH6pcCsSUs7pAQHlx1MrDqz06IvYMmaVyVrqLfKCc01T6rsvTmrIvFn7rTWK11FVqOO3X6Q6gZCvOgSIlWiQ2uJ00tF0dO4zb"); 

function App() {
  return (
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/products" element={<ProductsPage />} />
        <Route path="/add-product" element={<AddProductPage />} />
        <Route path="/register" element={<RegisterPage />} /> 
        <Route path="/forgot-password" element={<ForgotPasswordPage />} />
        <Route path="/cart" element={<CartPage />} />
        <Route path="/account" element={<AccountPage />} /> 
        <Route path="/orders" element={<OrdersPage />} />
        <Route path="/support" element={<SupportPage />} />
        <Route path="/wallet" element={<WalletPage />} />
        <Route path="/addresses" element={<AddressesPage />} />
        <Route path="/success" element={<SuccessPage />} />
        <Route path="/cancel" element={<CancelPage />} />
        <Route path="/admin" element={<AdminDashboardPage />} />
        <Route path="/admin/users" element={<AdminUsersPage />} />
      </Routes>
  );
}

export default App;
